INSERT INTO `wp_posts` VALUES (1,1,'2021-10-24 11:45:00','2021-10-24 11:45:00','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','trash','open','open','','hello-world__trashed','','','2021-12-04 00:21:12','2021-12-04 00:21:12','',0,'http://localhost/?p=1',0,'post','',1),(2,1,'2021-10-24 11:45:00','2021-10-24 11:45:00','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2021-10-24 11:45:00','2021-10-24 11:45:00','',0,'http://localhost/?page_id=2',0,'page','',0),(3,1,'2021-10-24 11:45:00','2021-10-24 11:45:00','<!-- wp:heading -->\n<h2>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Comments</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Media</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Cookies</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Embedded content from other websites</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->','Privacy Policy','','publish','closed','open','','privacy-policy','','','2021-10-28 19:31:04','2021-10-28 19:31:04','',0,'http://localhost/?page_id=3',0,'page','',0),(5,1,'2021-10-25 21:42:33','2021-10-25 21:42:33','<!-- wp:paragraph -->\n<p>The&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Battle_of_Marais_des_Cygnes\">Battle of Marais des Cygnes</a></strong>&nbsp;took place on October&nbsp;25, 1864, in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Linn_County,_Kansas\">Linn County, Kansas</a>, during&nbsp;<a href=\"https://en.wikipedia.org/wiki/Price%27s_Missouri_Expedition\">Price\'s Missouri Raid</a>&nbsp;in the&nbsp;<a href=\"https://en.wikipedia.org/wiki/American_Civil_War\">American Civil War</a>. A large&nbsp;<a href=\"https://en.wikipedia.org/wiki/Confederate_States_Army\">Confederate</a>&nbsp;cavalry incursion into&nbsp;<a href=\"https://en.wikipedia.org/wiki/Missouri\">Missouri</a>&nbsp;in late 1864 attempted to draw&nbsp;<a href=\"https://en.wikipedia.org/wiki/Union_Army\">Union</a>&nbsp;troops away from the fighting further east. After several victories the Confederates were defeated at the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Battle_of_Westport\">Battle of Westport</a>&nbsp;and withdrew into&nbsp;<a href=\"https://en.wikipedia.org/wiki/Kansas\">Kansas</a>. They camped along the banks of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Marais_des_Cygnes_River\">Marais des Cygnes River</a>&nbsp;on the night of October&nbsp;24 while Union cavalry pursuers&nbsp;<a href=\"https://en.wikipedia.org/wiki/Skirmisher\">skirmished</a>&nbsp;with their&nbsp;<a href=\"https://en.wikipedia.org/wiki/Rearguard\">rear guard</a>. The battle began early the next morning as 3,500 Union troops drove this force from its position, capturing cannons, prisoners, and wagons. An attempted stand at the river crossing was&nbsp;<a href=\"https://en.wikipedia.org/wiki/Flanking_maneuver\">outflanked</a>&nbsp;by a Union cavalry&nbsp;<a href=\"https://en.wikipedia.org/wiki/Regiment\">regiment</a>, forcing the Confederates to abandon it. A rear guard action by a 1,200-man Confederate&nbsp;<a href=\"https://en.wikipedia.org/wiki/Brigade\">brigade</a>&nbsp;bought time to disengage and retreat. After two further defeats on the same day and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Second_Battle_of_Newtonia\">another on October&nbsp;28</a>, the Confederates retreated to&nbsp;<a href=\"https://en.wikipedia.org/wiki/Texas\">Texas</a>.</p>\n<!-- /wp:paragraph -->','First Test Post','','trash','open','open','','first-test-post__trashed','','','2021-12-04 00:21:12','2021-12-04 00:21:12','',0,'http://localhost/?p=5',0,'post','',0),(6,1,'2021-10-25 21:42:33','2021-10-25 21:42:33','<!-- wp:paragraph -->\n<p>The <strong><a href=\"https://en.wikipedia.org/wiki/Battle_of_Marais_des_Cygnes\">Battle of Marais des Cygnes</a></strong> took place on October 25, 1864, in <a href=\"https://en.wikipedia.org/wiki/Linn_County,_Kansas\">Linn County, Kansas</a>, during <a href=\"https://en.wikipedia.org/wiki/Price%27s_Missouri_Expedition\">Price\'s Missouri Raid</a> in the <a href=\"https://en.wikipedia.org/wiki/American_Civil_War\">American Civil War</a>. A large <a href=\"https://en.wikipedia.org/wiki/Confederate_States_Army\">Confederate</a> cavalry incursion into <a href=\"https://en.wikipedia.org/wiki/Missouri\">Missouri</a> in late 1864 attempted to draw <a href=\"https://en.wikipedia.org/wiki/Union_Army\">Union</a> troops away from the fighting further east. After several victories the Confederates were defeated at the <a href=\"https://en.wikipedia.org/wiki/Battle_of_Westport\">Battle of Westport</a> and withdrew into <a href=\"https://en.wikipedia.org/wiki/Kansas\">Kansas</a>. They camped along the banks of the <a href=\"https://en.wikipedia.org/wiki/Marais_des_Cygnes_River\">Marais des Cygnes River</a> on the night of October 24 while Union cavalry pursuers <a href=\"https://en.wikipedia.org/wiki/Skirmisher\">skirmished</a> with their <a href=\"https://en.wikipedia.org/wiki/Rearguard\">rear guard</a>. The battle began early the next morning as 3,500 Union troops drove this force from its position, capturing cannons, prisoners, and wagons. An attempted stand at the river crossing was <a href=\"https://en.wikipedia.org/wiki/Flanking_maneuver\">outflanked</a> by a Union cavalry <a href=\"https://en.wikipedia.org/wiki/Regiment\">regiment</a>, forcing the Confederates to abandon it. A rear guard action by a 1,200-man Confederate <a href=\"https://en.wikipedia.org/wiki/Brigade\">brigade</a> bought time to disengage and retreat. After two further defeats on the same day and <a href=\"https://en.wikipedia.org/wiki/Second_Battle_of_Newtonia\">another on October 28</a>, the Confederates retreated to <a href=\"https://en.wikipedia.org/wiki/Texas\">Texas</a>.</p>\n<!-- /wp:paragraph -->','First Test Post','','inherit','closed','closed','','5-revision-v1','','','2021-10-25 21:42:33','2021-10-25 21:42:33','',5,'http://localhost/?p=6',0,'revision','',0),(7,1,'2021-10-25 21:43:18','2021-10-25 21:43:18','<!-- wp:paragraph -->\n<p>The&nbsp;<strong><a href=\"https://en.wikipedia.org/wiki/Roberto_Clemente_Award\">Roberto Clemente Award</a></strong>&nbsp;is given annually to the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Major_League_Baseball\">Major League Baseball</a>&nbsp;(MLB)&nbsp;<a href=\"https://en.wikipedia.org/wiki/Baseball_positions\">player</a>&nbsp;who \"best exemplifies the game of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Baseball\">baseball</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sportsmanship\">sportsmanship</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Community#Psychology\">community</a>&nbsp;involvement and the individual\'s contribution to his team\", as voted on by baseball&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fan_(person)\">fans</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sports_journalism\">members</a>&nbsp;of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/News_media\">media</a>. It is named for&nbsp;<a href=\"https://en.wikipedia.org/wiki/National_Baseball_Hall_of_Fame_and_Museum\">Hall of Fame</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Outfielder\">outfielder</a>&nbsp;<a href=\"https://en.wikipedia.org/wiki/Roberto_Clemente\">Roberto Clemente</a>. Originally known as the Commissioner\'s Award, it has been presented by MLB since 1971. In 1973, the award was renamed after Clemente following&nbsp;<a href=\"https://en.wikipedia.org/wiki/1972_Puerto_Rico_DC-7_crash\">his death in a plane crash</a>&nbsp;while he was delivering supplies to victims of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/1972_Nicaragua_earthquake\">Nicaragua earthquake</a>. The first recipient of the award was&nbsp;<a href=\"https://en.wikipedia.org/wiki/Willie_Mays\">Willie Mays</a>&nbsp;<em>(pictured)</em>, and the most recent honoree is&nbsp;<a href=\"https://en.wikipedia.org/wiki/Adam_Wainwright\">Adam Wainwright</a>. The first&nbsp;<a href=\"https://en.wikipedia.org/wiki/Pitcher\">pitcher</a>&nbsp;to receive the award was&nbsp;<a href=\"https://en.wikipedia.org/wiki/Phil_Niekro\">Phil Niekro</a>&nbsp;in 1980, and the first&nbsp;<a href=\"https://en.wikipedia.org/wiki/Catcher\">catcher</a>&nbsp;to receive it was&nbsp;<a href=\"https://en.wikipedia.org/wiki/Gary_Carter\">Gary Carter</a>&nbsp;in 1989. The team to have the most winners representing their club is the&nbsp;<a href=\"https://en.wikipedia.org/wiki/St._Louis_Cardinals\">St. Louis Cardinals</a>.</p>\n<!-- /wp:paragraph -->','Second Test Post','','trash','open','open','','second-test-post__trashed','','','2021-12-04 00:21:11','2021-12-04 00:21:11','',0,'http://localhost/?p=7',0,'post','',0),(8,1,'2021-10-25 21:43:18','2021-10-25 21:43:18','<!-- wp:paragraph -->\n<p>The <strong><a href=\"https://en.wikipedia.org/wiki/Roberto_Clemente_Award\">Roberto Clemente Award</a></strong> is given annually to the <a href=\"https://en.wikipedia.org/wiki/Major_League_Baseball\">Major League Baseball</a> (MLB) <a href=\"https://en.wikipedia.org/wiki/Baseball_positions\">player</a> who \"best exemplifies the game of <a href=\"https://en.wikipedia.org/wiki/Baseball\">baseball</a>, <a href=\"https://en.wikipedia.org/wiki/Sportsmanship\">sportsmanship</a>, <a href=\"https://en.wikipedia.org/wiki/Community#Psychology\">community</a> involvement and the individual\'s contribution to his team\", as voted on by baseball <a href=\"https://en.wikipedia.org/wiki/Fan_(person)\">fans</a> and <a href=\"https://en.wikipedia.org/wiki/Sports_journalism\">members</a> of the <a href=\"https://en.wikipedia.org/wiki/News_media\">media</a>. It is named for <a href=\"https://en.wikipedia.org/wiki/National_Baseball_Hall_of_Fame_and_Museum\">Hall of Fame</a> <a href=\"https://en.wikipedia.org/wiki/Outfielder\">outfielder</a> <a href=\"https://en.wikipedia.org/wiki/Roberto_Clemente\">Roberto Clemente</a>. Originally known as the Commissioner\'s Award, it has been presented by MLB since 1971. In 1973, the award was renamed after Clemente following <a href=\"https://en.wikipedia.org/wiki/1972_Puerto_Rico_DC-7_crash\">his death in a plane crash</a> while he was delivering supplies to victims of the <a href=\"https://en.wikipedia.org/wiki/1972_Nicaragua_earthquake\">Nicaragua earthquake</a>. The first recipient of the award was <a href=\"https://en.wikipedia.org/wiki/Willie_Mays\">Willie Mays</a> <em>(pictured)</em>, and the most recent honoree is <a href=\"https://en.wikipedia.org/wiki/Adam_Wainwright\">Adam Wainwright</a>. The first <a href=\"https://en.wikipedia.org/wiki/Pitcher\">pitcher</a> to receive the award was <a href=\"https://en.wikipedia.org/wiki/Phil_Niekro\">Phil Niekro</a> in 1980, and the first <a href=\"https://en.wikipedia.org/wiki/Catcher\">catcher</a> to receive it was <a href=\"https://en.wikipedia.org/wiki/Gary_Carter\">Gary Carter</a> in 1989. The team to have the most winners representing their club is the <a href=\"https://en.wikipedia.org/wiki/St._Louis_Cardinals\">St. Louis Cardinals</a>.</p>\n<!-- /wp:paragraph -->','Second Test Post','','inherit','closed','closed','','7-revision-v1','','','2021-10-25 21:43:18','2021-10-25 21:43:18','',7,'http://localhost/?p=8',0,'revision','',0),(13,1,'2021-10-28 19:31:04','2021-10-28 19:31:04','<!-- wp:heading -->\n<h2>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Comments</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>